import React from "react";

const Skills = ({ skillsData }) => {
  return (
    <div class="container mx-auto">
    <h1 class="text-4xl font-bold mb-4">Skills</h1>
    <div class="logos flex flex-wrap justify-content-space-between">
      {logos.map((logo) => (
        <div class="logo">
          <img src={logo.src} alt={logo.alt} class="w-full h-full" />
          <span class="text-gray-500 text-sm mb-2">{logo.title}</span>
        </div>
      ))}
    </div>
    </div>
  );
};

export default Skills;
